INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (2, "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 44, 27, "ヒヨリ", 16, "獣人族", 100101, 0, "人助けが大好き！　前向き格闘娘", "人助け、応援", 155, 8, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (2, "トゥインクルウィッシュ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 47, 5, "ユイ", 17, "ヒューマン", 100201, 0, "戦闘のサポートが得意な、心優しい少女", "料理、人間観察", 158, 4, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (2, "トゥインクルウィッシュ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 46, 12, "レイ", 18, "魔族", 100301, 0, "クールで何事にも真っ直ぐな剣士", "読書、乗馬、お茶", 163, 1, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (5, "リトルリリカル", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "諸星すみれ", 27, 10, "ミソギ", 9, "ヒューマン", 100401, 0, "探検好きのイタズラっ子", "いたずら、探検", 128, 8, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (8, "王宮騎士団（NIGHTMARE）", "？？？", "下田麻美", 40, 25, "マツリ", 12, "獣人族", 100501, 0, "ヒーローに憧れる騎士見習いの少女", "ヒーローごっこ", 146, 11, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (7, "悪魔偽王国軍（ディアボロス）", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "浅倉杏美", 42, 22, "アカリ", 13, "魔族", 100601, 0, "甘え上手なみんなの人気者", "サックス", 150, 11, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (7, "悪魔偽王国軍（ディアボロス）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 32, 23, "ミヤコ", 14, "魔族", 100701, 0, "プリン大好きゴースト娘", "プリンを食べること", 130, 1, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (15, "ヴァイスフリューゲル　ランドソル支部", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 40, 10, "ユキ", 14, "エルフ", 100801, 0, "ボクは誰よりも美しい", "鏡で自分を見ること", 150, 10, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (13, "トワイライトキャラバン", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 45, 5, "アンナ", 17, "魔族", 100901, 0, "前世を信じる中二病患者、「疾風の冥姫」", "小説執筆", 159, 7, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (10, "自警団（カォン）", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "内田真礼", 42, 22, "マホ", 16, "獣人族", 101001, 0, "マホマホ王国のプリンセス", "空想、ぬいぐるみ集め", 155, 9, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (3, "ラビリンス", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "阿澄佳奈", 44, 25, "リノ", 15, "ヒューマン", 101101, 0, "人懐っこくてマシンガントークな妹系少女", "お裁縫", 156, 8, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (6, "フォレスティエ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "大橋彩香", 46, 24, "ハツネ", 17, "エルフ", 101201, 0, "みんなのために超能力を使う眠り姫", "妹と遊ぶこと、二度寝、昼寝、早寝", 156, 12, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (13, "トワイライトキャラバン", "", "佳村はるか", 55, 21, "ナナカ", 18, "魔族", 101301, 0, "オタク全開な魔法少女", "読書、魔法", 166, 8, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (10, "自警団（カォン）", "test", "水瀬いのり", 41, 3, "カスミ", 15, "獣人族", 101401, 0, "頭脳明晰な美少女名探偵", "読書、推理", 152, 11, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (6, "フォレスティエ", "test", "國府田マリ子", 54, 5, "ミサト", 21, "エルフ", 101501, 0, "母性溢れる優しいみんなの「ミサト先生」", "絵本作り", 165, 9, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (14, "ルーセント学院", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "上坂すみれ", 48, 10, "スズナ", 18, "魔族", 101601, 0, "天真爛漫で人気者のカリスマモデル", "ファッション", 167, 4, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (10, "自警団（カォン）", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 53, 7, "カオリ", 19, "獣人族", 101701, 0, "いつでも「なんくるないさ～」な天然娘", "踊り、空手", 158, 7, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (14, "ルーセント学院", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "伊藤静", 52, 14, "イオ", 23, "魔族", 101801, 0, "多くの男性を魅了する無垢な女教師", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 162, 8, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (5, "リトルリリカル", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "日高里菜", 21, 3, "ミミ", 10, "獣人族", 102001, 0, "お歌もにんじんも、ウサギさんも大好き♪", "かわいいもの集め", 117, 4, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (9, "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 40, 9, "クルミ", 12, "ヒューマン", 102101, 0, "泣き虫で臆病な守ってあげたい女の子", "観劇、おままごと", 150, 6, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (7, "悪魔偽王国軍（ディアボロス）", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "原紗友里", 40, 22, "ヨリ", 13, "魔族", 102201, 0, "人見知りであまのじゃくな女の子", "ゲーム全般", 150, 11, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (9, "サレンディア救護院", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 38, 10, "アヤネ", 14, "ヒューマン", 102301, 0, "ぷうきちといつも一緒！", "屋内でできる遊び", 148, 5, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (9, "サレンディア救護院", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 43, 12, "スズメ", 15, "ヒューマン", 102501, 0, "お嬢さまのためにがんばるドジっ娘メイド", "ご奉仕", 154, 12, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (11, "牧場（エリザベスパーク）", "test", "小岩井ことり", 42, 1, "リン", 17, "獣人族", 102601, 0, "遊びと睡眠が何より大事なぐうたら娘", "あんパン", 144, 1, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (13, "トワイライトキャラバン", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 43, 30, "エリコ", 16, "魔族", 102701, 0, "運命の相手に一途すぎる乙女", "実験、裁縫、料理", 154, 7, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (9, "サレンディア救護院", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "堀江由衣", 43, 4, "サレン", 17, "エルフ", 102801, 0, "救護院を経営する優しい庶民派お嬢様", "経営、お茶会", 156, 10, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (4, "カルミナ", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "日笠陽子", 40, 24, "ノゾミ", 17, "ヒューマン", 102901, 0, "歌って踊れる大人気アイドル", "舞台鑑賞、ダンス", 157, 1, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (15, "ヴァイスフリューゲル　ランドソル支部", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 51, 31, "ニノン", 16, "ヒューマン", 103001, 0, "トーゴクの神秘、オシエテクダサイ！", "忍法開発", 163, 8, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (7, "悪魔偽王国軍（ディアボロス）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 42, 22, "シノブ", 18, "魔族", 103101, 0, "占いが得意な霊能少女", "占い", 157, 12, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (12, "メルクリウス財団", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "松嵜麗", 45, 12, "アキノ", 18, "ヒューマン", 103201, 0, "一人前の商人を目指すパワフルお嬢様", "慈善事業", 157, 3, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (11, "牧場（エリザベスパーク）", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "新田恵海", 35, 3, "マヒル", 20, "ヒューマン", 103301, 0, "みんなを笑顔にするお笑い牧場主", "漫才", 142, 3, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (12, "メルクリウス財団", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "今井麻美", 55, 16, "ユカリ", 22, "エルフ", 103401, 0, "純情でほっとけない大人の女性", "ウインドーショッピング", 164, 3, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (5, "リトルリリカル", "test", "小倉唯", 21, 2, "キョウカ", 8, "エルフ", 103601, 0, "礼儀正しくしっかり者のちびっ子優等生", "お勉強", 118, 2, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (8, "王宮騎士団（NIGHTMARE）", "test", "茅原実里", 43, 11, "トモ", 13, "ヒューマン", 103701, 0, "義理堅くてからかい好きな剣術少女", "剣術、年長者をからかう", 149, 8, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (11, "牧場（エリザベスパーク）", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "小清水亜美", 40, 3, "シオリ", 14, "獣人族", 103801, 0, "読書が趣味の病弱少女", "読書、お散歩", 153, 11, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (6, "フォレスティエ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "花澤香菜", 44, 6, "アオイ", 13, "エルフ", 104001, 0, "「友達」に憧れる、エルフの森の女の子", "友達作りのイメトレ", 158, 6, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (4, "カルミナ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 46, 3, "チカ", 17, "ヒューマン", 104201, 0, "人々を守るために歌う、唱喚士の少女", "各種楽器", 163, 6, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (10, "自警団（カォン）", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "小松未可子", 54, 9, "マコト", 17, "獣人族", 104301, 0, "男勝りで情に厚いワイルド娘", "お菓子作り", 168, 8, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (7, "悪魔偽王国軍（ディアボロス）", "test", "丹下桜", 50, 5, "イリヤ", "??", "魔族", 104401, 0, "かつては夜を支配した最強の吸血鬼", "世界征服", 172, 5, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (15, "ヴァイスフリューゲル　ランドソル支部", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 49, 19, "クウカ", 18, "ヒューマン", 104501, 0, "妄想大好き！　ほんとは照れ屋な女の子", "小説を読むこと", 157, 11, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (12, "メルクリウス財団", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 48, 1, "タマキ", 18, "獣人族", 104601, 0, "弱きを助け強きをくじく猫娘", "猫とたわむれること", 158, 3, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (8, "王宮騎士団（NIGHTMARE）", "？？？", "川澄綾子", 50, 25, "ジュン", 25, "ヒューマン", 104701, 0, "素顔を見せない冷静沈着な女性騎士", "格闘技、湯浴み", 171, 10, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (12, "メルクリウス財団", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 49, 11, "ミフユ", 20, "ヒューマン", 104801, 0, "仕事も私事も効率優先な傭兵少女", "傭兵などのアルバイト", 163, 11, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (3, "ラビリンス", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 54, 24, "シズル", 18, "ヒューマン", 104901, 0, "お姉ちゃんがお世話してあげるからねっ！", "家事全般", 168, 10, "O");
