INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (4, "カルミナ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 46, 3, "チカ（クリスマス）", 17, "ヒューマン", 108401, 0, "人々を守るために歌う、唱喚士の少女", "各種楽器", 163, 6, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (9, "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 40, 9, "クルミ（クリスマス）", 12, "ヒューマン", 108501, 0, "泣き虫で臆病な守ってあげたい女の子", "観劇、おままごと", 150, 6, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (9, "サレンディア救護院", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 38, 10, "アヤネ（クリスマス）", 14, "ヒューマン", 108601, 0, "ぷうきちといつも一緒！", "屋内でできる遊び", 148, 5, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (2, "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 44, 27, "ヒヨリ（ニューイヤー）", 16, "獣人族", 108701, 0, "人助けが大好き！　前向き格闘娘", "人助け、応援", 155, 8, "A");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (2, "トゥインクルウィッシュ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 47, 5, "ユイ（ニューイヤー）", 17, "ヒューマン", 108801, 0, "戦闘のサポートが得意な、心優しい少女", "料理、人間観察", 158, 4, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (2, "トゥインクルウィッシュ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 46, 12, "レイ（ニューイヤー）", 18, "魔族", 108901, 0, "クールで何事にも真っ直ぐな剣士", "読書、乗馬、お茶", 163, 1, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (13, "トワイライトキャラバン", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 43, 30, "エリコ（バレンタイン）", 16, "魔族", 109001, 0, "運命の相手に一途すぎる乙女", "実験、裁縫、料理", 154, 7, "B");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES (3, "ラビリンス", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 54, 24, "シズル（バレンタイン）", 18, "ヒューマン", 109101, 0, "お姉ちゃんがお世話してあげるからねっ！", "家事全般", 168, 10, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES ("", "？？？", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "日笠陽子", 55, 1, "アン", 17, "ヒューマン", 109201, 0, "英霊と契約を結んだマナリアの天才王女", "読書", 156, 12, "AB");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES ("", "？？？", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "こやまきみこ", 45, 4, "ルゥ", 15, "ヒューマン", 109301, 0, "マナリア魔法学院の新入生", "食べること、眠ること", 144, 2, "O");
INSERT INTO `v1_da173341acbe16fd1a86db0a8f87e7f0f686555661f2e4513c6e5e20d54bb2a7` VALUES ("", "？？？", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "福原綾香", 67, 3, "グレア", 17, "半人半竜", 109401, 0, "人を超越した力を有す心優しい竜姫", "ピアノ", 167, 11, "B");
